        "# OLS and Control Variables: Simulation"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 1000
        },
        "id": "9iWYKW1KNSbO",
        "outputId": "b5ef588d-5c25-4365-ab61-f3d9d2765417"
      },
      "source": [
        "set.seed(2323) # makes simulation reproducible\n",
        "\n",
        "u <- rbinom(n = 1000, size = 1, prob = 0.5) # binary u\n",
        "x <- u + runif(n = 1000, min = 0, max = 2) # x is a function of u and uniform noise\n",
        "y <- -0.25*x + u + rnorm(n = 1000, sd = 0.75) # y is a function of x, u, and Gaussian noise\n",
        "\n",
        "summary(lm(y ~ x))\n",
        "summary(lm(y ~ x + u))\n",
        "\n",
        "plot(x, y)\n",
        "abline(lm(y ~ x))\n",
        "\n",
        "plot(x, y, col = u + 1)\n",
        "legend(\"bottomright\", legend = c(\"U = 0\", \"U = 1\"), fill = c(\"black\", \"red\"))\n",
        "\n",
        "abline(lm(y[u == 0] ~ x[u == 0]))\n",
        "abline(lm(y[u == 1] ~ x[u == 1]), col = \"red\")"
      ],
      "execution_count": null,
