      "source": [
        "# Simulation for Post-Treatment Bias"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "kFH9mRYDlV4-",
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 272
        },
        "outputId": "4551b186-6148-4374-b906-e07c80607edf"
      },
      "source": [
        "set.seed(2983)\n",
        "D <- rnorm(1000)\n",
        "U <- rnorm(1000)\n",
        "M <- 0.6*D + 0.6*U + rnorm(1000)\n",
        "Y <- 0.6*U + rnorm(1000)\n",
        "lm(Y ~ D)\n",
        "lm(Y ~ D + M)"
      ],
      "execution_count": null,
      "outputs": [
