        "# runs sensemakr for sensitivity analysis\n",
        "sensitivity.1 <- sensemakr(model.1, treatment = \"directlyharmed\",\n",
        "                               kd = 1:3)\n",
        "\n",
        "# plot bias contour of point estimate\n",
        "plot(sensitivity.1)\n",
        "\n",
