      "source": [
        "library(mediation)\n",
        "\n",
        "data(\"framing\")\n",
        "\n",
        "# generate treatment variable\n",
        "framing$tone_eth <- ifelse(framing$tone == 1 & framing$eth == 1, 1, 0)\n",
        "\n",
        "# average causal effect of treatment\n",
        "summary(lm(immigr ~ tone_eth, data = framing))"
      ],
