      "source": [
        "# Mediator model:\n",
        "model.m <- lm(emo ~ tone_eth, data = framing)\n",
        "\n",
        "# Outcome model:\n",
        "model.y <- lm(immigr ~ emo + tone_eth , data = framing)\n",
        "\n",
        "out.1 <- mediate(model.m, model.y, sims=1000, \n",
        "                 treat=\"tone_eth\", mediator=\"emo\", boot=FALSE)\n",
        "\n",
        "plot(out.1)\n",
        "\n",
        "summary(out.1)"
      ],
